(4373, 'Динжумановой Р.Т. Полимерлердің алу әдістері,Учебное пособие,2017', 'dinzhumanovoj-r-t-polimerlerdi-alu-adisteri', 'Эксперименттік бөлімге әр-қайсысына толық суреттелу жасалған зертханалық жұмыстар, оларға дайындалуға тиісті сұрақтар және есеп-жаттығулар кіреді.\r\nҚұрал жоғары оқу орындарының химия мамандағы бойынша оқитын студенттерге арналған. Түсінікті ғылыми тілімен жазылған', 'Оқу құралы екі бөлімнен тұрады: теориялық және зертханалық. Теориялық бөлімінде: радикалды полимерлену, катионды және анионды полимерлену, радикалды сополимерлену, ион-координациялық полимерлену, поликонденсациялану, олардың негізгі сатылары, кинетикасы және механизмі қарастырылады.\r\nЭксперименттік бөлімге әр-қайсысына толық суреттелу жасалған зертханалық жұмыстар, оларға дайындалуға тиісті сұрақтар және есеп-жаттығулар кіреді.\r\nҚұрал жоғары оқу орындарының химия мамандағы бойынша оқитын студенттерге арналған. Түсінікті ғылыми тілімен жазылған.', 'pdf.png', '', '', '', '', '', 1, 0, '0', '', 0, '1.25 MB', '2017-09-26 07:03:03', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Dinzhumanovoj R.T. Polimerlerdің alu аdіsterі.pdf', '', 0, '', '', 0, 0, '', '', '', 'Авто-импорт', 0, '', 'elib', 580, '2017-09-26 13:09:35', 0, 0, 5, 431, '', '', 0, 0, 0, 0, 0, 0, '', '', '', '', '', '0000-00-00', '0000-00-00', '', '', 0, '', 1694, 0, 0, '0000-00-00 00:00:00'),
(4374, 'Динжумановой Р.Т., Абековой Р.С. Көп ядролы конденсирленген және конденсирленбеген қосылыстар, Учебное пособие, 2017', 'kop-jadroly-kondensirlengen-zhane-kondensirlenbegen-kosylystar', '       Құрал жоғарғы оқу орындарының химия, органикалық заттардың химиялық технологиясы, биотехнология мамандықтары бойынша оқитын студенттерге арналған. Түсінікті ғылыми тілімен жазылған.', 'Оқу құралы екі бөлімнен тұрады: теориялық және практикалық. Теориялық бөлімде көп ядролы ароматты конденсирленген және конденсирленбеген қосылыстардың жалпы спаттамасы, изомериясы, алу әдістері, физикалық және химиялық қасиеттері, қолданылуы қарастырылған. Практикалық бөлімде көп ядролы ароматты қосылыстардың синтезі және қасиеттерін зерттеу негізіндегі зертханалық жұмыстар, оларға дайындалуға тиісті сұрақтар және есеп-жаттығулар берілген.', 'pdf.png', '', '', '', '', '', 1, 0, '0', '', 0, '1.69 MB', '2017-09-26 07:03:03', '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 0, 'Коp jadroly kondensirlengen zhаne kondensirlenbegen kosylystar.pdf', '', 0, '', '', 0, 0, '', '', '', 'Авто-импорт', 0, '', 'elib', 580, '2017-09-26 13:07:11', 0, 0, 6, 431, '', '', 0, 0, 0, 0, 0, 0, '', '', '', '', '', '0000-00-00', '0000-00-00', '', '', 0, '', 1695, 0, 0, '0000-00-00 00:00:00'),
